import React, { Component } from 'react';
 class App extends Component {
  state = {
    pictures: [{
      name: "Batman",
      picture: "data:image/jpeg;base64,",
      spot: "aPlace"
    },

    {
      name: "Wonder Woman",
      picture: "data:image/jpeg;base64,",
      spot: "aPlace"
    },

    {
      name: "Green Lantern",
      picture: "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQMGG6IdKCOi20D2CUwky3b0x6VwW3PGVjsvxY-BF3S0i_X3W91zdRN6I8",
      spot: "anotherPlace",
    }
    ]
  }
  onDragOver=(event)=>{
    event.preventDefault()
  }
  onDragStart=(event,id)=>{
    console.log(
      'dragstart:',id)
    event.dataTransfer.setData("id", id)
  }
   onDrop = (event, taco) => {
     let id = event.dataTransfer.getData("id");
     let pictures = this.state.pictures.filter((picture) => {
       if (picture.name == id) {
         picture.spot = taco;
       }
       return picture;
     });
     this.setState({
       ...this.state,
       pictures
     });
   }
  render() {
    var pictures = {
      aPlace: [],
      anotherPlace: []
    }
    this.state.pictures.forEach((p) => {
      pictures[p.spot].push(<div
        key={p.name}
        onDragStart={(event) => this.onDragStart(event, p.name)}
        draggable
        className="draggable">
       <img src={p.picture}/>
        {p.name}
        
      </div>);
    });
    return (<div className="container-drag">
        <h2 className="header">Spike</h2>
        <div className="wip"
          onDragOver={(event) => this.onDragOver(event)}
          onDrop={(event) => { this.onDrop(event, "anotherPlace") }}>
          <span >Another Place</span>
          {pictures.anotherPlace}
        </div>
        <div className="droppable"
       
         onDragOver={(e) => this.onDragOver(e)}
          onDrop={(e) => this.onDrop(e, "aPlace")}>
        <span >A Place</span>
          {pictures.aPlace}
        </div>
      </div>
    );
  }
}
export default App;